import React from 'react';
import './App.css';
import Navbar from './Compo/Navbar';
import {
  BrowserRouter as Router,
  Route,
  Routes
} from "react-router-dom";
import Home from './Compo/Pages/Home';


function App() {
  return (
    <>
    <Router>
       <Navbar/> 
       <Routes>
       <Route path="/" element={Home} />
       </Routes>
    </Router>

      </>
  );
}

export default App;
